  d_nlp.f = res[1];
  d_nlp.g = res[2];
  d_nlp.lam_x = res[3];
  d_nlp.lam_g = res[4];
  d_nlp.lam_p = res[5];
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 161;
  p_nlp.ng = 119;
  p_nlp.np = 145;
  p_nlp.detect_bounds.ng = 0;
