    d->arg[2] = d->Jk;
    d->arg[3] = d->lbdz+161;
    d->arg[4] = d->ubdz+161;
    d->res[0] = 0;
    d->res[1] = 0;
    d->res[2] = 0;
    d->res[3] = 0;
